import React from 'react';
import './App.css';
import Form from './Form';
import Item from './Item';

function App() { 
  return (
    <div className="app">
       <Form />
       <Item title="Eat" />
       <Item title="Sleep" />
       <Item title="Feri Eat" />
    </div>
  );  
}

export default App;
